import React, { useState } from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  padding: 20px;
  text-align: center;
`;

const SectionTitle = styled.h2`
  margin-top: 40px;
  margin-bottom: 20px;
`;

const SectionContainer = styled.div`
  display: flex;
  justify-content: space-around;
  flex-wrap: wrap;
`;

const Card = styled.div`
  width: 300px;
  padding: 20px;
  margin: 10px;
  background-color: #1c1c1c;
  color: white;
  border-radius: 8px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  cursor: pointer;
`;

const SearchContainer = styled.div`
  display: flex;
  justify-content: center;
  margin: 20px 0;
`;

const SearchInput = styled.input`
  padding: 10px;
  width: 300px;
  border: none;
  border-radius: 5px;
  font-size: 16px;
`;

const ResultCard = styled.div`
  display: flex;
  align-items: center;
  padding: 10px;
  margin: 10px;
  background-color: #1c1c1c;
  color: white;
  border-radius: 8px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  cursor: pointer;
`;

const ResultImage = styled.img`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  margin-right: 10px;
`;

const Home = ({ songs }) => {
  const [searchResults, setSearchResults] = useState([]);
  const [currentSong, setCurrentSong] = useState(null);
  const [isPlaying, setIsPlaying] = useState(false);

  const handleSearch = (query) => {
    const filteredSongs = songs.filter(song =>
      song.name.toLowerCase().includes(query.toLowerCase()) ||
      song.artist.toLowerCase().includes(query.toLowerCase())
    );
    setSearchResults(filteredSongs);
  };

  const playSong = (song) => {
    setCurrentSong(song);
    setIsPlaying(true);

    // Example: Start playing audio (replace with actual audio handling logic)
    console.log(`Now playing: ${song.name} by ${song.artist}`);
  };

  return (
    <HomeContainer>
      <h1>Welcome to Spotify 2.0</h1>

      <SearchContainer>
        <SearchInput
          type="text"
          placeholder="Search for songs..."
          onChange={(e) => handleSearch(e.target.value)}
        />
      </SearchContainer>

      {searchResults.length > 0 && (
        <div>
          <h3>Search Results</h3>
          <SectionContainer>
            {searchResults.map((song, index) => (
              <ResultCard key={index} onClick={() => playSong(song)}>
                <ResultImage src={song.image} alt={song.name} />
                <div>
                  <h4>{song.name}</h4>
                  <p>by {song.artist}</p>
                </div>
              </ResultCard>
            ))}
          </SectionContainer>
        </div>
      )}

      <SectionTitle>Top Songs</SectionTitle>
      <SectionContainer>
        {songs.map(song => (
          <Card key={song.id} onClick={() => playSong(song)}>
            <h3>{song.name}</h3>
            <p>by {song.artist}</p>
          </Card>
        ))}
      </SectionContainer>

      {/* Display currently playing song */}
      {currentSong && (
        <div>
          <h3>Now Playing</h3>
          <Card>
            <h3>{currentSong.name}</h3>
            <p>by {currentSong.artist}</p>
          </Card>
        </div>
      )}
    </HomeContainer>
  );
};

export default Home;
